import{_ as p,o as t,c as a,O as e}from"./chunks/framework.19e0a886.js";const s="/assets/img/pushCode.png",h=JSON.parse('{"title":"二零一八年总结","description":"","frontmatter":{"updateTime":"2019/01/05","title":"二零一八年总结"},"headers":[],"relativePath":"ESSAY/summary-of-2018.md","filePath":"ESSAY/summary-of-2018.md","lastUpdated":1685168533000}'),o={name:"ESSAY/summary-of-2018.md"},r=e('<h1 id="二零一八年总结" tabindex="-1">二零一八年总结 <a class="header-anchor" href="#二零一八年总结" aria-label="Permalink to &quot;二零一八年总结&quot;">​</a></h1><p>这一年我参与了十多个项目</p><p>撸了五万行代码，又默默删除了四万五千行</p><p>早十点是收割八阿哥效率最高的时间，十分钟能胜一天</p><p>最恐惧上下班时间点找我说话，一般没啥好事，而且会导致忘事</p><p>喜欢和同事讨论大家都不懂的技术知识</p><p>隔三差五地打开 GitHub，假装在造什么巨轮，但一年下来新博客还是只有首页</p><p>双十一，我看着柜子中飘动的四件带格子衣服，觉得这是栅格设计被嘲讽得最惨的一天</p><p>二零一八年一月，也是特别的一个月</p><p>这个月常常晚回家，做得像狗一样，汪汪汪，却得到像段子一样的结果</p><p>二零一八年一月十日这天我把 JUST DO <strong>IT</strong> 的广告文案反复问候了一百零八次，深夜十二点后仍在问候</p><p>热衷分享朋友圈，收藏了许多美好回忆，和段子一样的生活片段</p><p>朋友圈摄影大赛上，我是吐槽类选手中装逼最隐晦的，装逼类选手中最善于吐槽的</p><p>从不设置三天可见，因为也没有多少人会去翻看三天前的我</p><p>发广告的大部分屏蔽了，小部分发广告却还没被我屏蔽的都是真爱</p><p>全年奔波超过两万五千公里，平均每天花在路上的时间超过两小时</p><p>车上的我是孤独的，无论有没有乘客，因为总是在听东西</p><p>好不容易顺风车司机审核通过，没接几次单它就停止运营了，一个坐我车的美女都没有遇上</p><p>网易云为我整理的年度歌单中，从命运交响乐到闪闪的红星都赫然在列</p><p>大数据AI分析不到原因，说我听歌风格成迷</p><p>其实只是音乐APP被当成了起床闹铃</p><p>深夜还在听的歌，才是真的在听，习惯边听边看评论，表情像在哭又像笑</p><p>2019 内部 Gitlab 上的代码提交：</p><p><img src="'+s+'" alt="内部 Gitlab 上的代码提交"></p>',24),_=[r];function i(n,c,m,d,l,u){return t(),a("div",null,_)}const S=p(o,[["render",i]]);export{h as __pageData,S as default};
